import React, { useState, useEffect } from "react";
import ReactDOM from 'react-dom/client';
import CssBaseline from '@mui/material/CssBaseline';
import {
    Route, BrowserRouter, Routes, useNavigate
} from 'react-router-dom'
import "./style.css";


//for below will automatically look for index.js since working with javascript
import {
    Navbar,
    Posts,
    Profile,
    Home,
    Register,
    Login
  } from './Components';
  import {
    getPosts,
  } from './api';

/*
Components needed for this project:
Login
Registration
Posts
AddPost
Profile
Navbar

*/

const App = () => {
    const [ posts, setPosts ] = useState([]);
    const [ token, setToken ] = useState('');
    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
    const [userProfile, setUserProfile] = useState({})
    cosnt
    const navigate = useNavigate();

    console.log(token)

    const fetchPosts = async() => {
        const results = await getPosts()
        setPosts(results.data.posts)
    }

    useEffect (() => {
        fetchPosts()
    },[])

    return (
        <div>
            <Navbar setToken={setToken}/>
            <Routes>
                <Route path='/' element={<Home />} />
                <Route path='/posts' element={<Posts posts={posts} />} />
                <Route path='/profile' element={<Profile userProfile={userProfile} />} />
                <Route path='/register' element={<Register setUserProfile={setUserProfile} setToken={setToken} setUsername={setUsername} username={username} setPassword={setPassword} password={password} navigate={navigate}/>} />
                <Route path='/login' element={<Login setUserProfile={setUserProfile} setToken={setToken} setUsername={setUsername} username={username} setPassword={setPassword} password={password} navigate={navigate}/>} />
            </Routes>
        </div>
    )
}


//new way to render when react is 18 or later
const container = document.querySelector('#container');
const root = ReactDOM.createRoot(container);
root.render(
    <BrowserRouter>
        <CssBaseline>
            <App />
        </CssBaseline>
    </BrowserRouter>);
